	return (
		<motion.div
			style={{ padding: '5rem', background: "red", width: '100px' }}
			drag
			dragConstraints={{
				top: 10,
				bottom: 10,
				left: 10,
				right: 10
			}}
		> AA</ motion.div >
	);
}
export default App;
